puzzleInput = "    "

instructions = puzzleInput.split(" ")

# Generation of keys matrix
keys = []

for outer in range(3):
    keys.append([])
    for inner in range(1, 4):
        keys[-1].append((outer * 3) + inner)


row = 1
column = 1
code = []
for instruction in instructions:
    for char in instruction:
        if(char == "U" and row != 0):
            row -= 1
        elif(char == "D" and row != 2):
            row += 1
        elif(char == "L" and column != 0):
            column -= 1
        elif(char == "R" and column != 2):
            column += 1
    code.append(keys[row][column])

print(code)